"${profiler.info.dir}\" fork=\"true\" jvm=\"${profiler.info.jvm}\">\r\n                    <jvmarg line=\"${endorsed.classpath.cmd.line.arg}\"/>\r\n                    <jvmarg value=\"${profiler.info.jvmargs.agent}\"/>\r\n                    <jvmarg line=\"${profiler.info.jvmargs}\"/>\r\n                    <env key=\"${profiler.info.pathvar}\" path=\"${profiler.info.agentpath}:${profiler.current.path}\"/>\r\n                    <arg line=\"${application.args}\"/>\r\n                    <classpath>\r\n                        <path path=\"${run.classpath}\"/>\r\n                    </classpath>\r\n                    <syspropertyset>\r\n                        <propertyref prefix=\"run-sys-prop.\"/>\r\n                        <mapper from=\"run-sys-prop.*\" to=\"*\" type=\"glob\"/>\r\n                    </syspropertyset>\r\n                    <customize/>\r\n                </java>\r\n            </sequential>\r\n        </macrodef>\r\n    </target>\r\n    <target depends=\"-profile-pre-init, init, -profile-post-init, -profile-init-macrodef-profile\" if=\"profiler.info.jvmargs.agent\" name=\"-profile-init-check\">\r\n        <fail unless=\"profiler.info.jvm\">Must set JVM to use for profiling in profiler.info.jvm</fail>\r\n        <fail unless=\"profiler.info.jvmargs.agent\">Must set profiler agent JVM arguments in profiler.info.jvmargs.agent</fail>\r\n    </target>\r\n    <!--\r\n                end of pre NB7.2 profiling section\r\n            -->\r\n    <target depends=\"-init-debug-args\" name=\"-init-macrodef-nbjpda\">\r\n        <macrodef name=\"nbjpdastart\" uri=\"http://www.netbeans.org/ns/j2se-project/1\">\r\n            <attribute default=\"${main.class}\" name=\"name\"/>\r\n            <attribute default=\"${debug.classpath}\" name=\"classpath\"/>\r\n            <attribute default=\"\" name=\"stopclassname\"/>\r\n            <sequential>\r\n                <nbjpdastart addressproperty=\"jpda.address\" name=\"@{name}\" stopclassname=\"@{stopclassname}\" transport=\"${debug-transport}\">\r\n                    <classpath>\r\n                        <path path=\"@{classpath}\"/>\r\n                    </classpath>\r\n                </nbjpdastart>\r\n            </sequential>\r\n        </macrodef>\r\n        <macrodef name=\"nbjpdareload\" uri=\"http://www.netbeans.org/ns/j2se-project/1\">\r\n            <attribute default=\"${build.classes.dir}\" name=\"dir\"/>\r\n            <sequential>\r\n                <nbjpdareload>\r\n                    <fileset dir=\"@{dir}\" includes=\"${fix.classes}\">\r\n                        <include name=\"${fix.includes}*.class\"/>\r\n                    </fileset>\r\n                </nbjpdareload>\r\n            </sequential>\r\n        </macrodef>\r\n    </target>\r\n    <target name=\"-init-debug-args\">\r\n        <property name=\"version-output\" value=\"java version &quot;${ant.java.version}\"/>\r\n        <condition property=\"have-jdk-older-than-1.4\">\r\n            <or>\r\n                <contains string=\"${version-output}\" substring=\"java version &quot;1.0\"/>\r\n                <contains string=\"${version-output}\" substring=\"java version &quot;1.1\"/>\r\n                <contains string=\"${version-output}\" substring=\"java version &quot;1.2\"/>\r\n                <contains string=\"${version-output}\" substring=\"java version &quot;1.3\"/>\r\n            </or>\r\n        </condition>\r\n        <condition else=\"-Xdebug\" property=\"debug-args-line\" value=\"-Xdebug -Xnoagent -Djava.compiler=none\">\r\n            <istrue value=\"${have-jdk-older-than-1.4}\"/>\r\n        </condition>\r\n        <condition else=\"dt_socket\" property=\"debug-transport-by-os\" value=\"dt_shmem\">\r\n            <os family=\"windows\"/>\r\n        </condition>\r\n        <condition else=\"${debug-transport-by-os}\" property=\"debug-transport\" value=\"${debug.transport}\">\r\n            <isset property=\"debug.transport\"/>\r\n        </condition>\r\n    </target>\r\n    <target depends=\"-init-debug-args\" name=\"-init-macrodef-debug\">\r\n        <macrodef name=\"debug\" uri=\"http://www.netbeans.org/ns/j2se-project/3\">\r\n            <attribute default=\"${main.class}\" name=\"classname\"/>\r\n            <attribute default=\"${debug.classpath}\" name=\"classpath\"/>\r\n            <element name=\"customize\" optional=\"true\"/>\r\n            <sequential>\r\n                <java classname=\"@{classname}\" dir=\"/\" fork=\"true\">\r\n                    <jvmarg line=\"${endorsed.classpath.cmd.line.arg}\"/>\r\n                    <jvmarg line=\"${debug-args-line}\"/>\r\n                    <jvmarg value=\"-Xrunjdwp:transport=${debug-transport},address=${jpda.address}\"/>\r\n                    <jvmarg value=\"-Dfile.encoding=${runtime.encoding}\"/>\r\n                    <redirector errorencoding=\"${runtime.encoding}\" inputencoding=\"${runtime.encoding}\" outputencoding=\"${runtime.encoding}\"/>\r\n                    <jvmarg line=\"${run.jvmargs}\"/>\r\n                    <jvmarg line=\"${run.jvmargs.ide}\"/>\r\n                    <classpath>\r\n                        <path path=\"@{classpath}\"/>\r\n                    </classpath>\r\n                    <syspropertyset>\r\n                        <propertyref prefix=\"run-sys-prop.\"/>\r\n                        <mapper from=\"run-sys-prop.*\" to=\"*\" type=\"glob\"/>\r\n                    </syspropertyset>\r\n                    <customize/>\r\n                </java>\r\n            </sequential>\r\n        </macrodef>\r\n    </target>\r\n    <target name=\"-init-macrodef-java\">\r\n        <macrodef name=\"java\" uri=\"http://www.netbeans.org/ns/j2se-project/1\">\r\n            <attribute default=\"${main.class}\" name=\"classname\"/>\r\n            <attribute default=\"${run.classpath}\" name=\"classpath\"/>\r\n            <attribute default=\"jvm\" name=\"jvm\"/>\r\n            <element name=\"customize\" optional=\"true\"/>\r\n            <sequential>\r\n                <java classname=\"@{classname}\" dir=\"/\" fork=\"true\">\r\n                    <jvmarg line=\"${endorsed.classpath.cmd.line.arg}\"/>\r\n                    <jvmarg value=\"-Dfile.encoding=${runtime.encoding}\"/>\r\n                    <redirector errorencoding=\"${runtime.encoding}\" inputencoding=\"${runtime.encoding}\" outputencoding=\"${runtime.encoding}\"/>\r\n                    <jvmarg line=\"${run.jvmargs}\"/>\r\n                    <jvmarg line=\"${run.jvmargs.ide}\"/>\r\n                    <classpath>\r\n                        <path path=\"@{classpath}\"/>\r\n                    </classpath>\r\n                    <syspropertyset>\r\n                        <propertyref prefix=\"run-sys-prop.\"/>\r\n                        <mapper from=\"run-sys-prop.*\" to=\"*\" type=\"glob\"/>\r\n                    </syspropertyset>\r\n                    <customize/>\r\n                </java>\r\n            </sequential>\r\n        </macrodef>\r\n    </target>\r\n    <target name=\"-init-macrodef-copylibs\">\r\n        <macrodef name=\"copylibs\" uri=\"http://www.netbeans.org/ns/j2se-project/3\">\r\n            <attribute default=\"${manifest.file}\" name=\"manifest\"/>\r\n            <element name=\"customize\" optional=\"true\"/>\r\n            <sequential>\r\n                <property location=\"${build.classes.dir}\" name=\"build.classes.dir.resolved\"/>\r\n                <pathconvert property=\"run.classpath.without.build.classes.dir\">\r\n                    <path path=\"${run.classpath}\"/>\r\n                    <map from=\"${build.classes.dir.resolved}\" to=\"\"/>\r\n                </pathconvert>\r\n                <pathconvert pathsep=\" \" property=\"jar.classpath\">\r\n                    <path path=\"build-impl.xml\"/>\r\n                    <chainedmapper>\r\n                        <flattenmapper/>\r\n                        <filtermapper>\r\n                            <replacestring from=\" \" to=\"%20\"/>\r\n                        </filtermapper>\r\n                        <globmapper from=\"*\" to=\"lib/*\"/>\r\n                    </chainedmapper>\r\n                </pathconvert>\r\n                <taskdef classname=\"org.netbeans.modules.java.j2seproject.copylibstask.CopyLibs\" classpath=\"${libs.CopyLibs.classpath}\" name=\"copylibs\"/>\r\n                <copylibs compress=\"${jar.compress}\" excludeFromCopy=\"${copylibs.excludes}\" index=\"${jar.index}\" indexMetaInf=\"${jar.index.metainf}\" jarfile=\"${dist.jar}\" manifest=\"@{manifest}\" rebase=\"${copylibs.rebase}\" runtimeclasspath=\"${run.classpath.without.build.classes.dir}\">\r\n                    <fileset dir=\"${build.classes.dir}\" excludes=\"${dist.archive.excludes}\"/>\r\n                    <manifest>\r\n                        <attribute name=\"Class-Path\" value=\"${jar.classpath}\"/>\r\n                        <customize/>\r\n                    </manifest>\r\n                </copylibs>\r\n            </sequential>\r\n        </macrodef>\r\n    </target>\r\n    <target name=\"-init-presetdef-jar\">\r\n        <presetdef name=\"jar\" uri=\"http://www.netbeans.org/ns/j2se-project/1\">\r\n            <jar compress=\"${jar.compress}\" index=\"${jar.index}\" jarfile=\"${dist.jar}\">\r\n                <j2seproject1:fileset dir=\"${build.classes.dir}\" excludes=\"${dist.archive.excludes}\"/>\r\n            </jar>\r\n        </presetdef>\r\n    </target>\r\n    <target name=\"-init-ap-cmdline-properties\">\r\n        <property name=\"annotation.processing.enabled\" value=\"true\"/>\r\n        <property name=\"annotation.processing.processors.list\" value=\"\"/>\r\n        <property name=\"annotation.processing.processor.options\" value=\"\"/>\r\n        <property name=\"annotation.processing.run.all.processors\" value=\"true\"/>\r\n        <property name=\"javac.processorpath\" value=\"${javac.classpath}\"/>\r\n        <property name=\"javac.test.processorpath\" value=\"${javac.test.classpath}\"/>\r\n        <condition property=\"ap.supported.internal\" value=\"true\">\r\n            <not>\r\n                <matches pattern=\"1\\.[0-5](\\..*)?\" string=\"${javac.source}\"/>\r\n            </not>\r\n        </condition>\r\n    </target>\r\n    <target depends=\"-init-ap-cmdline-properties\" if=\"ap.supported.internal\" name=\"-init-ap-cmdline-supported\">\r\n        <condition else=\"\" property=\"ap.processors.internal\" value=\"-processor ${annotation.processing.processors.list}\">\r\n            <isfalse value=\"${annotation.processing.run.all.processors}\"/>\r\n        </condition>\r\n        <condition else=\"\" property=\"ap.proc.none.internal\" value=\"-proc:none\">\r\n            <isfalse value=\"${annotation.processing.enabled}\"/>\r\n        </condition>\r\n    </target>\r\n    <target depends=\"-init-ap-cmdline-properties,-init-ap-cmdline-supported\" name=\"-init-ap-cmdline\">\r\n        <property name=\"ap.cmd.line.internal\" value=\"\"/>\r\n    </target>\r\n    <target depends=\"-pre-init,-init-private,-init-user,-init-project,-do-init,-post-init,-init-check,-init-macrodef-property,-init-macrodef-javac,-init-macrodef-test,-init-macrodef-test-debug,-init-macrodef-nbjpda,-init-macrodef-debug,-init-macrodef-java,-init-presetdef-jar,-init-ap-cmdline\" name=\"init\"/>\r\n    <!--\r\n                ===================\r\n                COMPILATION SECTION\r\n                ===================\r\n            -->\r\n    <target name=\"-deps-jar-init\" unless=\"built-jar.properties\">\r\n        <property location=\"${build.dir}/built-jar.properties\" name=\"built-jar.properties\"/>\r\n        <delete file=\"${built-jar.properties}\" quiet=\"true\"/>\r\n    </target>\r\n    <target if=\"already.built.jar.${basedir}\" name=\"-warn-already-built-jar\">\r\n        <echo level=\"warn\" message=\"Cycle detected: asd was aleady built\"/>\r\n    </target>\r\n    <target depends=\"init,-deps-jar-init\" name=\"deps-jar\" unless=\"no.deps\">\r\n        <mkdir dir=\"${build.dir}\"/>\r\n        <touch file=\"${built-jar.properties}\" verbose=\"false\"/>\r\n        <property file=\"${built-jar.properties}\" prefix=\"already.built.jar.\"/>\r\n        <antcall target=\"-warn-already-built-jar\"/>\r\n        <propertyfile file=\"${built-jar.properties}\">\r\n            <entry key=\"${basedir}\" value=\"\"/>\r\n        </propertyfile>\r\n    </target>\r\n    <target depends=\"init,-check-automatic-build,-clean-after-automatic-build\" name=\"-verify-automatic-build\"/>\r\n    <target depends=\"init\" name=\"-check-automatic-build\">\r\n        <available file=\"${build.classes.dir}/.netbeans_automatic_build\" property=\"netbeans.automatic.build\"/>\r\n    </target>\r\n    <target depends=\"init\" if=\"netbeans.automatic.build\" name=\"-clean-after-automatic-build\">\r\n        <antcall target=\"clean\"/>\r\n    </target>\r\n    <target depends=\"init,deps-jar\" name=\"-pre-pre-compile\">\r\n        <mkdir dir=\"${build.classes.dir}\"/>\r\n    </target>\r\n    <target name=\"-pre-compile\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target if=\"do.depend.true\" name=\"-compile-depend\">\r\n        <pathconvert property=\"build.generated.subdirs\">\r\n            <dirset dir=\"${build.generated.sources.dir}\" erroronmissingdir=\"false\">\r\n                <include name=\"*\"/>\r\n            </dirset>\r\n        </pathconvert>\r\n        <j2seproject3:depend srcdir=\"${src.dir}:${build.generated.subdirs}\"/>\r\n    </target>\r\n    <target depends=\"init,deps-jar,-pre-pre-compile,-pre-compile, -copy-persistence-xml,-compile-depend\" if=\"have.sources\" name=\"-do-compile\">\r\n        <j2seproject3:javac gensrcdir=\"${build.generated.sources.dir}\"/>\r\n        <copy todir=\"${build.classes.dir}\">\r\n            <fileset dir=\"${src.dir}\" excludes=\"${build.classes.excludes},${excludes}\" includes=\"${includes}\"/>\r\n        </copy>\r\n    </target>\r\n    <target if=\"has.persistence.xml\" name=\"-copy-persistence-xml\">\r\n        <mkdir dir=\"${build.classes.dir}/META-INF\"/>\r\n        <copy todir=\"${build.classes.dir}/META-INF\">\r\n            <fileset dir=\"${meta.inf.dir}\" includes=\"persistence.xml orm.xml\"/>\r\n        </copy>\r\n    </target>\r\n    <target name=\"-post-compile\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,deps-jar,-verify-automatic-build,-pre-pre-compile,-pre-compile,-do-compile,-post-compile\" description=\"Compile project.\" name=\"compile\"/>\r\n    <target name=\"-pre-compile-single\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,deps-jar,-pre-pre-compile\" name=\"-do-compile-single\">\r\n        <fail unless=\"javac.includes\">Must select some files in the IDE or set javac.includes</fail>\r\n        <j2seproject3:force-recompile/>\r\n        <j2seproject3:javac excludes=\"\" gensrcdir=\"${build.generated.sources.dir}\" includes=\"${javac.includes}\" sourcepath=\"${src.dir}\"/>\r\n    </target>\r\n    <target name=\"-post-compile-single\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,deps-jar,-verify-automatic-build,-pre-pre-compile,-pre-compile-single,-do-compile-single,-post-compile-single\" name=\"compile-single\"/>\r\n    <!--\r\n                ====================\r\n                JAR BUILDING SECTION\r\n                ====================\r\n            -->\r\n    <target depends=\"init\" name=\"-pre-pre-jar\">\r\n        <dirname file=\"${dist.jar}\" property=\"dist.jar.dir\"/>\r\n        <mkdir dir=\"/\"/>\r\n    </target>\r\n    <target name=\"-pre-jar\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init\" if=\"do.archive\" name=\"-do-jar-create-manifest\" unless=\"manifest.available\">\r\n        <tempfile deleteonexit=\"true\" destdir=\"${build.dir}\" property=\"tmp.manifest.file\"/>\r\n        <touch file=\"build-impl.xml\" verbose=\"false\"/>\r\n    </target>\r\n    <target depends=\"init\" if=\"do.archive+manifest.available\" name=\"-do-jar-copy-manifest\">\r\n        <tempfile deleteonexit=\"true\" destdir=\"${build.dir}\" property=\"tmp.manifest.file\"/>\r\n        <copy file=\"${manifest.file}\" tofile=\"build-impl.xml\"/>\r\n    </target>\r\n    <target depends=\"init,-do-jar-create-manifest,-do-jar-copy-manifest\" if=\"do.archive+main.class.available\" name=\"-do-jar-set-mainclass\">\r\n        <manifest file=\"build-impl.xml\" mode=\"update\">\r\n            <attribute name=\"Main-Class\" value=\"${main.class}\"/>\r\n        </manifest>\r\n    </target>\r\n    <target depends=\"init,-do-jar-create-manifest,-do-jar-copy-manifest\" if=\"do.archive+profile.available\" name=\"-do-jar-set-profile\">\r\n        <manifest file=\"build-impl.xml\" mode=\"update\">\r\n            <attribute name=\"Profile\" value=\"${javac.profile}\"/>\r\n        </manifest>\r\n    </target>\r\n    <target depends=\"init,-do-jar-create-manifest,-do-jar-copy-manifest\" if=\"do.archive+splashscreen.available\" name=\"-do-jar-set-splashscreen\">\r\n        <basename file=\"${application.splash}\" property=\"splashscreen.basename\"/>\r\n        <mkdir dir=\"${build.classes.dir}/META-INF\"/>\r\n        <copy failonerror=\"false\" file=\"${application.splash}\" todir=\"${build.classes.dir}/META-INF\"/>\r\n        <manifest file=\"build-impl.xml\" mode=\"update\">\r\n            <attribute name=\"SplashScreen-Image\" value=\"META-INF/${splashscreen.basename}\"/>\r\n        </manifest>\r\n    </target>\r\n    <target depends=\"init,-init-macrodef-copylibs,compile,-pre-pre-jar,-pre-jar,-do-jar-create-manifest,-do-jar-copy-manifest,-do-jar-set-mainclass,-do-jar-set-profile,-do-jar-set-splashscreen\" if=\"do.mkdist\" name=\"-do-jar-copylibs\">\r\n        <j2seproject3:copylibs manifest=\"${tmp.manifest.file}\"/>\r\n        <echo level=\"info\">To run this application from the command line without Ant, try:</echo>\r\n        <property location=\"${dist.jar}\" name=\"dist.jar.resolved\"/>\r\n        <echo level=\"info\">java -jar \"${dist.jar.resolved}\"</echo>\r\n    </target>\r\n    <target depends=\"init,compile,-pre-pre-jar,-pre-jar,-do-jar-create-manifest,-do-jar-copy-manifest,-do-jar-set-mainclass,-do-jar-set-profile,-do-jar-set-splashscreen\" if=\"do.archive\" name=\"-do-jar-jar\" unless=\"do.mkdist\">\r\n        <j2seproject1:jar manifest=\"build-impl.xml\"/>\r\n        <property location=\"${build.classes.dir}\" name=\"build.classes.dir.resolved\"/>\r\n        <property location=\"${dist.jar}\" name=\"dist.jar.resolved\"/>\r\n        <pathconvert property=\"run.classpath.with.dist.jar\">\r\n            <path path=\"${run.classpath}\"/>\r\n            <map from=\"${build.classes.dir.resolved}\" to=\"${dist.jar.resolved}\"/>\r\n        </pathconvert>\r\n        <condition else=\"\" property=\"jar.usage.message\" value=\"To run this application from the command line without Ant, try:${line.separator}${platform.java} -cp ${run.classpath.with.dist.jar} ${main.class}\">\r\n            <isset property=\"main.class.available\"/>\r\n        </condition>\r\n        <condition else=\"debug\" property=\"jar.usage.level\" value=\"info\">\r\n            <isset property=\"main.class.available\"/>\r\n        </condition>\r\n        <echo level=\"${jar.usage.level}\" message=\"${jar.usage.message}\"/>\r\n    </target>\r\n    <target depends=\"-do-jar-copylibs\" if=\"do.archive\" name=\"-do-jar-delete-manifest\">\r\n        <delete>\r\n            <fileset file=\"build-impl.xml\"/>\r\n        </delete>\r\n    </target>\r\n    <target depends=\"init,compile,-pre-pre-jar,-pre-jar,-do-jar-create-manifest,-do-jar-copy-manifest,-do-jar-set-mainclass,-do-jar-set-profile,-do-jar-set-splashscreen,-do-jar-jar,-do-jar-delete-manifest\" name=\"-do-jar-without-libraries\"/>\r\n    <target depends=\"init,compile,-pre-pre-jar,-pre-jar,-do-jar-create-manifest,-do-jar-copy-manifest,-do-jar-set-mainclass,-do-jar-set-profile,-do-jar-set-splashscreen,-do-jar-copylibs,-do-jar-delete-manifest\" name=\"-do-jar-with-libraries\"/>\r\n    <target name=\"-post-jar\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,compile,-pre-jar,-do-jar-without-libraries,-do-jar-with-libraries,-post-jar\" name=\"-do-jar\"/>\r\n    <target depends=\"init,compile,-pre-jar,-do-jar,-post-jar\" description=\"Build JAR.\" name=\"jar\"/>\r\n    <!--\r\n                =================\r\n                EXECUTION SECTION\r\n                =================\r\n            -->\r\n    <target depends=\"init,compile\" description=\"Run a main class.\" name=\"run\">\r\n        <j2seproject1:java>\r\n            <customize>\r\n                <arg line=\"${application.args}\"/>\r\n            </customize>\r\n        </j2seproject1:java>\r\n    </target>\r\n    <target name=\"-do-not-recompile\">\r\n        <property name=\"javac.includes.binary\" value=\"\"/>\r\n    </target>\r\n    <target depends=\"init,compile-single\" name=\"run-single\">\r\n        <fail unless=\"run.class\">Must select one file in the IDE or set run.class</fail>\r\n        <j2seproject1:java classname=\"${run.class}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single\" name=\"run-test-with-main\">\r\n        <fail unless=\"run.class\">Must select one file in the IDE or set run.class</fail>\r\n        <j2seproject1:java classname=\"${run.class}\" classpath=\"${run.test.classpath}\"/>\r\n    </target>\r\n    <!--\r\n                =================\r\n                DEBUGGING SECTION\r\n                =================\r\n            -->\r\n    <target depends=\"init\" if=\"netbeans.home\" name=\"-debug-start-debugger\">\r\n        <j2seproject1:nbjpdastart name=\"${debug.class}\"/>\r\n    </target>\r\n    <target depends=\"init\" if=\"netbeans.home\" name=\"-debug-start-debugger-main-test\">\r\n        <j2seproject1:nbjpdastart classpath=\"${debug.test.classpath}\" name=\"${debug.class}\"/>\r\n    </target>\r\n    <target depends=\"init,compile\" name=\"-debug-start-debuggee\">\r\n        <j2seproject3:debug>\r\n            <customize>\r\n                <arg line=\"${application.args}\"/>\r\n            </customize>\r\n        </j2seproject3:debug>\r\n    </target>\r\n    <target depends=\"init,compile,-debug-start-debugger,-debug-start-debuggee\" description=\"Debug project in IDE.\" if=\"netbeans.home\" name=\"debug\"/>\r\n    <target depends=\"init\" if=\"netbeans.home\" name=\"-debug-start-debugger-stepinto\">\r\n        <j2seproject1:nbjpdastart stopclassname=\"${main.class}\"/>\r\n    </target>\r\n    <target depends=\"init,compile,-debug-start-debugger-stepinto,-debug-start-debuggee\" if=\"netbeans.home\" name=\"debug-stepinto\"/>\r\n    <target depends=\"init,compile-single\" if=\"netbeans.home\" name=\"-debug-start-debuggee-single\">\r\n        <fail unless=\"debug.class\">Must select one file in the IDE or set debug.class</fail>\r\n        <j2seproject3:debug classname=\"${debug.class}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-single,-debug-start-debugger,-debug-start-debuggee-single\" if=\"netbeans.home\" name=\"debug-single\"/>\r\n    <target depends=\"init,compile-test-single\" if=\"netbeans.home\" name=\"-debug-start-debuggee-main-test\">\r\n        <fail unless=\"debug.class\">Must select one file in the IDE or set debug.class</fail>\r\n        <j2seproject3:debug classname=\"${debug.class}\" classpath=\"${debug.test.classpath}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-debug-start-debugger-main-test,-debug-start-debuggee-main-test\" if=\"netbeans.home\" name=\"debug-test-with-main\"/>\r\n    <target depends=\"init\" name=\"-pre-debug-fix\">\r\n        <fail unless=\"fix.includes\">Must set fix.includes</fail>\r\n        <property name=\"javac.includes\" value=\"${fix.includes}.java\"/>\r\n    </target>\r\n    <target depends=\"init,-pre-debug-fix,compile-single\" if=\"netbeans.home\" name=\"-do-debug-fix\">\r\n        <j2seproject1:nbjpdareload/>\r\n    </target>\r\n    <target depends=\"init,-pre-debug-fix,-do-debug-fix\" if=\"netbeans.home\" name=\"debug-fix\"/>\r\n    <!--\r\n                =================\r\n                PROFILING SECTION\r\n                =================\r\n            -->\r\n    <!--\r\n                pre NB7.2 profiler integration\r\n            -->\r\n    <target depends=\"profile-init,compile\" description=\"Profile a project in the IDE.\" if=\"profiler.info.jvmargs.agent\" name=\"-profile-pre72\">\r\n        <fail unless=\"netbeans.home\">This target only works when run from inside the NetBeans IDE.</fail>\r\n        <nbprofiledirect>\r\n            <classpath>\r\n                <path path=\"${run.classpath}\"/>\r\n            </classpath>\r\n        </nbprofiledirect>\r\n        <profile/>\r\n    </target>\r\n    <target depends=\"profile-init,compile-single\" description=\"Profile a selected class in the IDE.\" if=\"profiler.info.jvmargs.agent\" name=\"-profile-single-pre72\">\r\n        <fail unless=\"profile.class\">Must select one file in the IDE or set profile.class</fail>\r\n        <fail unless=\"netbeans.home\">This target only works when run from inside the NetBeans IDE.</fail>\r\n        <nbprofiledirect>\r\n            <classpath>\r\n                <path path=\"${run.classpath}\"/>\r\n            </classpath>\r\n        </nbprofiledirect>\r\n        <profile classname=\"${profile.class}\"/>\r\n    </target>\r\n    <target depends=\"profile-init,compile-single\" if=\"profiler.info.jvmargs.agent\" name=\"-profile-applet-pre72\">\r\n        <fail unless=\"netbeans.home\">This target only works when run from inside the NetBeans IDE.</fail>\r\n        <nbprofiledirect>\r\n            <classpath>\r\n                <path path=\"${run.classpath}\"/>\r\n            </classpath>\r\n        </nbprofiledirect>\r\n        <profile classname=\"sun.applet.AppletViewer\">\r\n            <customize>\r\n                <arg value=\"${applet.url}\"/>\r\n            </customize>\r\n        </profile>\r\n    </target>\r\n    <target depends=\"profile-init,compile-test-single\" if=\"profiler.info.jvmargs.agent\" name=\"-profile-test-single-pre72\">\r\n        <fail unless=\"netbeans.home\">This target only works when run from inside the NetBeans IDE.</fail>\r\n        <nbprofiledirect>\r\n            <classpath>\r\n                <path path=\"${run.test.classpath}\"/>\r\n            </classpath>\r\n        </nbprofiledirect>\r\n        <junit dir=\"${profiler.info.dir}\" errorproperty=\"tests.failed\" failureproperty=\"tests.failed\" fork=\"true\" jvm=\"${profiler.info.jvm}\" showoutput=\"true\">\r\n            <env key=\"${profiler.info.pathvar}\" path=\"${profiler.info.agentpath}:${profiler.current.path}\"/>\r\n            <jvmarg value=\"${profiler.info.jvmargs.agent}\"/>\r\n            <jvmarg line=\"${profiler.info.jvmargs}\"/>\r\n            <test name=\"${profile.class}\"/>\r\n            <classpath>\r\n                <path path=\"${run.test.classpath}\"/>\r\n            </classpath>\r\n            <syspropertyset>\r\n                <propertyref prefix=\"test-sys-prop.\"/>\r\n                <mapper from=\"test-sys-prop.*\" to=\"*\" type=\"glob\"/>\r\n            </syspropertyset>\r\n            <formatter type=\"brief\" usefile=\"false\"/>\r\n            <formatter type=\"xml\"/>\r\n        </junit>\r\n    </target>\r\n    <!--\r\n                end of pre NB72 profiling section\r\n            -->\r\n    <target if=\"netbeans.home\" name=\"-profile-check\">\r\n        <condition property=\"profiler.configured\">\r\n            <or>\r\n                <contains casesensitive=\"true\" string=\"${run.jvmargs.ide}\" substring=\"-agentpath:\"/>\r\n                <contains casesensitive=\"true\" string=\"${run.jvmargs.ide}\" substring=\"-javaagent:\"/>\r\n            </or>\r\n        </condition>\r\n    </target>\r\n    <target depends=\"-profile-check,-profile-pre72\" description=\"Profile a project in the IDE.\" if=\"profiler.configured\" name=\"profile\" unless=\"profiler.info.jvmargs.agent\">\r\n        <startprofiler/>\r\n        <antcall target=\"run\"/>\r\n    </target>\r\n    <target depends=\"-profile-check,-profile-single-pre72\" description=\"Profile a selected class in the IDE.\" if=\"profiler.configured\" name=\"profile-single\" unless=\"profiler.info.jvmargs.agent\">\r\n        <fail unless=\"run.class\">Must select one file in the IDE or set run.class</fail>\r\n        <startprofiler/>\r\n        <antcall target=\"run-single\"/>\r\n    </target>\r\n    <target depends=\"-profile-test-single-pre72\" description=\"Profile a selected test in the IDE.\" name=\"profile-test-single\"/>\r\n    <target depends=\"-profile-check\" description=\"Profile a selected test in the IDE.\" if=\"profiler.configured\" name=\"profile-test\" unless=\"profiler.info.jvmargs\">\r\n        <fail unless=\"test.includes\">Must select some files in the IDE or set test.includes</fail>\r\n        <startprofiler/>\r\n        <antcall target=\"test-single\"/>\r\n    </target>\r\n    <target depends=\"-profile-check\" description=\"Profile a selected class in the IDE.\" if=\"profiler.configured\" name=\"profile-test-with-main\">\r\n        <fail unless=\"run.class\">Must select one file in the IDE or set run.class</fail>\r\n        <startprofiler/>\r\n        <antcal target=\"run-test-with-main\"/>\r\n    </target>\r\n    <target depends=\"-profile-check,-profile-applet-pre72\" if=\"profiler.configured\" name=\"profile-applet\" unless=\"profiler.info.jvmargs.agent\">\r\n        <fail unless=\"applet.url\">Must select one file in the IDE or set applet.url</fail>\r\n        <startprofiler/>\r\n        <antcall target=\"run-applet\"/>\r\n    </target>\r\n    <!--\r\n                ===============\r\n                JAVADOC SECTION\r\n                ===============\r\n            -->\r\n    <target depends=\"init\" if=\"have.sources\" name=\"-javadoc-build\">\r\n        <mkdir dir=\"${dist.javadoc.dir}\"/>\r\n        <condition else=\"\" property=\"javadoc.endorsed.classpath.cmd.line.arg\" value=\"-J${endorsed.classpath.cmd.line.arg}\">\r\n            <and>\r\n                <isset property=\"endorsed.classpath.cmd.line.arg\"/>\r\n                <not>\r\n                    <equals arg1=\"${endorsed.classpath.cmd.line.arg}\" arg2=\"\"/>\r\n                </not>\r\n            </and>\r\n        </condition>\r\n        <condition else=\"\" property=\"bug5101868workaround\" value=\"*.java\">\r\n            <matches pattern=\"1\\.[56](\\..*)?\" string=\"${java.version}\"/>\r\n        </condition>\r\n        <javadoc additionalparam=\"-J-Dfile.encoding=${file.encoding} ${javadoc.additionalparam}\" author=\"${javadoc.author}\" charset=\"UTF-8\" destdir=\"${dist.javadoc.dir}\" docencoding=\"UTF-8\" encoding=\"${javadoc.encoding.used}\" failonerror=\"true\" noindex=\"${javadoc.noindex}\" nonavbar=\"${javadoc.nonavbar}\" notree=\"${javadoc.notree}\" private=\"${javadoc.private}\" source=\"${javac.source}\" splitindex=\"${javadoc.splitindex}\" use=\"${javadoc.use}\" useexternalfile=\"true\" version=\"${javadoc.version}\" windowtitle=\"${javadoc.windowtitle}\">\r\n            <classpath>\r\n                <path path=\"${javac.classpath}\"/>\r\n            </classpath>\r\n            <fileset dir=\"${src.dir}\" excludes=\"${bug5101868workaround},${excludes}\" includes=\"${includes}\">\r\n                <filename name=\"**/*.java\"/>\r\n            </fileset>\r\n            <fileset dir=\"${build.generated.sources.dir}\" erroronmissingdir=\"false\">\r\n                <include name=\"**/*.java\"/>\r\n                <exclude name=\"*.java\"/>\r\n            </fileset>\r\n            <arg line=\"${javadoc.endorsed.classpath.cmd.line.arg}\"/>\r\n        </javadoc>\r\n        <copy todir=\"${dist.javadoc.dir}\">\r\n            <fileset dir=\"${src.dir}\" excludes=\"${excludes}\" includes=\"${includes}\">\r\n                <filename name=\"**/doc-files/**\"/>\r\n            </fileset>\r\n            <fileset dir=\"${build.generated.sources.dir}\" erroronmissingdir=\"false\">\r\n                <include name=\"**/doc-files/**\"/>\r\n            </fileset>\r\n        </copy>\r\n    </target>\r\n    <target depends=\"init,-javadoc-build\" if=\"netbeans.home\" name=\"-javadoc-browse\" unless=\"no.javadoc.preview\">\r\n        <nbbrowse file=\"${dist.javadoc.dir}/index.html\"/>\r\n    </target>\r\n    <target depends=\"init,-javadoc-build,-javadoc-browse\" description=\"Build Javadoc.\" name=\"javadoc\"/>\r\n    <!--\r\n                =========================\r\n                TEST COMPILATION SECTION\r\n                =========================\r\n            -->\r\n    <target depends=\"init,compile\" if=\"have.tests\" name=\"-pre-pre-compile-test\">\r\n        <mkdir dir=\"${build.test.classes.dir}\"/>\r\n    </target>\r\n    <target name=\"-pre-compile-test\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target if=\"do.depend.true\" name=\"-compile-test-depend\">\r\n        <j2seproject3:depend classpath=\"${javac.test.classpath}\" destdir=\"${build.test.classes.dir}\" srcdir=\"${test.src.dir}\"/>\r\n    </target>\r\n    <target depends=\"init,deps-jar,compile,-pre-pre-compile-test,-pre-compile-test,-compile-test-depend\" if=\"have.tests\" name=\"-do-compile-test\">\r\n        <j2seproject3:javac apgeneratedsrcdir=\"${build.test.classes.dir}\" classpath=\"${javac.test.classpath}\" debug=\"true\" destdir=\"${build.test.classes.dir}\" processorpath=\"${javac.test.processorpath}\" srcdir=\"${test.src.dir}\"/>\r\n        <copy todir=\"${build.test.classes.dir}\">\r\n            <fileset dir=\"${test.src.dir}\" excludes=\"${build.classes.excludes},${excludes}\" includes=\"${includes}\"/>\r\n        </copy>\r\n    </target>\r\n    <target name=\"-post-compile-test\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,compile,-pre-pre-compile-test,-pre-compile-test,-do-compile-test,-post-compile-test\" name=\"compile-test\"/>\r\n    <target name=\"-pre-compile-test-single\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,deps-jar,compile,-pre-pre-compile-test,-pre-compile-test-single\" if=\"have.tests\" name=\"-do-compile-test-single\">\r\n        <fail unless=\"javac.includes\">Must select some files in the IDE or set javac.includes</fail>\r\n        <j2seproject3:force-recompile destdir=\"${build.test.classes.dir}\"/>\r\n        <j2seproject3:javac apgeneratedsrcdir=\"${build.test.classes.dir}\" classpath=\"${javac.test.classpath}\" debug=\"true\" destdir=\"${build.test.classes.dir}\" excludes=\"\" includes=\"${javac.includes}\" processorpath=\"${javac.test.processorpath}\" sourcepath=\"${test.src.dir}\" srcdir=\"${test.src.dir}\"/>\r\n        <copy todir=\"${build.test.classes.dir}\">\r\n            <fileset dir=\"${test.src.dir}\" excludes=\"${build.classes.excludes},${excludes}\" includes=\"${includes}\"/>\r\n        </copy>\r\n    </target>\r\n    <target name=\"-post-compile-test-single\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,compile,-pre-pre-compile-test,-pre-compile-test-single,-do-compile-test-single,-post-compile-test-single\" name=\"compile-test-single\"/>\r\n    <!--\r\n                =======================\r\n                TEST EXECUTION SECTION\r\n                =======================\r\n            -->\r\n    <target depends=\"init\" if=\"have.tests\" name=\"-pre-test-run\">\r\n        <mkdir dir=\"${build.test.results.dir}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test,-pre-test-run\" if=\"have.tests\" name=\"-do-test-run\">\r\n        <j2seproject3:test includes=\"${includes}\" testincludes=\"**/*Test.java\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test,-pre-test-run,-do-test-run\" if=\"have.tests\" name=\"-post-test-run\">\r\n        <fail if=\"tests.failed\" unless=\"ignore.failing.tests\">Some tests failed; see details above.</fail>\r\n    </target>\r\n    <target depends=\"init\" if=\"have.tests\" name=\"test-report\"/>\r\n    <target depends=\"init\" if=\"netbeans.home+have.tests\" name=\"-test-browse\"/>\r\n    <target depends=\"init,compile-test,-pre-test-run,-do-test-run,test-report,-post-test-run,-test-browse\" description=\"Run unit tests.\" name=\"test\"/>\r\n    <target depends=\"init\" if=\"have.tests\" name=\"-pre-test-run-single\">\r\n        <mkdir dir=\"${build.test.results.dir}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single\" if=\"have.tests\" name=\"-do-test-run-single\">\r\n        <fail unless=\"test.includes\">Must select some files in the IDE or set test.includes</fail>\r\n        <j2seproject3:test excludes=\"\" includes=\"${test.includes}\" testincludes=\"${test.includes}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single,-do-test-run-single\" if=\"have.tests\" name=\"-post-test-run-single\">\r\n        <fail if=\"tests.failed\" unless=\"ignore.failing.tests\">Some tests failed; see details above.</fail>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single,-do-test-run-single,-post-test-run-single\" description=\"Run single unit test.\" name=\"test-single\"/>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single\" if=\"have.tests\" name=\"-do-test-run-single-method\">\r\n        <fail unless=\"test.class\">Must select some files in the IDE or set test.class</fail>\r\n        <fail unless=\"test.method\">Must select some method in the IDE or set test.method</fail>\r\n        <j2seproject3:test excludes=\"\" includes=\"${javac.includes}\" testincludes=\"${test.class}\" testmethods=\"${test.method}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single,-do-test-run-single-method\" if=\"have.tests\" name=\"-post-test-run-single-method\">\r\n        <fail if=\"tests.failed\" unless=\"ignore.failing.tests\">Some tests failed; see details above.</fail>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single,-do-test-run-single-method,-post-test-run-single-method\" description=\"Run single unit test.\" name=\"test-single-method\"/>\r\n    <!--\r\n                =======================\r\n                TEST DEBUGGING SECTION\r\n                =======================\r\n            -->\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single\" if=\"have.tests\" name=\"-debug-start-debuggee-test\">\r\n        <fail unless=\"test.class\">Must select one file in the IDE or set test.class</fail>\r\n        <j2seproject3:test-debug excludes=\"\" includes=\"${javac.includes}\" testClass=\"${test.class}\" testincludes=\"${javac.includes}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-pre-test-run-single\" if=\"have.tests\" name=\"-debug-start-debuggee-test-method\">\r\n        <fail unless=\"test.class\">Must select one file in the IDE or set test.class</fail>\r\n        <fail unless=\"test.method\">Must select some method in the IDE or set test.method</fail>\r\n        <j2seproject3:test-debug excludes=\"\" includes=\"${javac.includes}\" testClass=\"${test.class}\" testMethod=\"${test.method}\" testincludes=\"${test.class}\" testmethods=\"${test.method}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test\" if=\"netbeans.home+have.tests\" name=\"-debug-start-debugger-test\">\r\n        <j2seproject1:nbjpdastart classpath=\"${debug.test.classpath}\" name=\"${test.class}\"/>\r\n    </target>\r\n    <target depends=\"init,compile-test-single,-debug-start-debugger-test,-debug-start-debuggee-test\" name=\"debug-test\"/>\r\n    <target depends=\"init,compile-test-single,-debug-start-debugger-test,-debug-start-debuggee-test-method\" name=\"debug-test-method\"/>\r\n    <target depends=\"init,-pre-debug-fix,compile-test-single\" if=\"netbeans.home\" name=\"-do-debug-fix-test\">\r\n        <j2seproject1:nbjpdareload dir=\"${build.test.classes.dir}\"/>\r\n    </target>\r\n    <target depends=\"init,-pre-debug-fix,-do-debug-fix-test\" if=\"netbeans.home\" name=\"debug-fix-test\"/>\r\n    <!--\r\n                =========================\r\n                APPLET EXECUTION SECTION\r\n                =========================\r\n            -->\r\n    <target depends=\"init,compile-single\" name=\"run-applet\">\r\n        <fail unless=\"applet.url\">Must select one file in the IDE or set applet.url</fail>\r\n        <j2seproject1:java classname=\"sun.applet.AppletViewer\">\r\n            <customize>\r\n                <arg value=\"${applet.url}\"/>\r\n            </customize>\r\n        </j2seproject1:java>\r\n    </target>\r\n    <!--\r\n                =========================\r\n                APPLET DEBUGGING  SECTION\r\n                =========================\r\n            -->\r\n    <target depends=\"init,compile-single\" if=\"netbeans.home\" name=\"-debug-start-debuggee-applet\">\r\n        <fail unless=\"applet.url\">Must select one file in the IDE or set applet.url</fail>\r\n        <j2seproject3:debug classname=\"sun.applet.AppletViewer\">\r\n            <customize>\r\n                <arg value=\"${applet.url}\"/>\r\n            </customize>\r\n        </j2seproject3:debug>\r\n    </target>\r\n    <target depends=\"init,compile-single,-debug-start-debugger,-debug-start-debuggee-applet\" if=\"netbeans.home\" name=\"debug-applet\"/>\r\n    <!--\r\n                ===============\r\n                CLEANUP SECTION\r\n                ===============\r\n            -->\r\n    <target name=\"-deps-clean-init\" unless=\"built-clean.properties\">\r\n        <property location=\"${build.dir}/built-clean.properties\" name=\"built-clean.properties\"/>\r\n        <delete file=\"${built-clean.properties}\" quiet=\"true\"/>\r\n    </target>\r\n    <target if=\"already.built.clean.${basedir}\" name=\"-warn-already-built-clean\">\r\n        <echo level=\"warn\" message=\"Cycle detected: asd was already built\"/>\r\n    </target>\r\n    <target depends=\"init,-deps-clean-init\" name=\"deps-clean\" unless=\"no.deps\">\r\n        <mkdir dir=\"${build.dir}\"/>\r\n        <touch file=\"${built-clean.properties}\" verbose=\"false\"/>\r\n        <property file=\"${built-clean.properties}\" prefix=\"already.built.clean.\"/>\r\n        <antcall target=\"-warn-already-built-clean\"/>\r\n        <propertyfile file=\"${built-clean.properties}\">\r\n            <entry key=\"${basedir}\" value=\"\"/>\r\n        </propertyfile>\r\n    </target>\r\n    <target depends=\"init\" name=\"-do-clean\">\r\n        <delete dir=\"${build.dir}\"/>\r\n        <delete dir=\"${dist.dir}\" followsymlinks=\"false\" includeemptydirs=\"true\"/>\r\n    </target>\r\n    <target name=\"-post-clean\">\r\n        <!-- Empty placeholder for easier customization. -->\r\n        <!-- You can override this target in the ../build.xml file. -->\r\n    </target>\r\n    <target depends=\"init,deps-clean,-do-clean,-post-clean\" description=\"Clean build products.\" name=\"clean\"/>\r\n    <target name=\"-check-call-dep\">\r\n        <property file=\"${call.built.properties}\" prefix=\"already.built.\"/>\r\n        <condition property=\"should.call.dep\">\r\n            <and>\r\n                <not>\r\n                    <isset property=\"already.built.${call.subproject}\"/>\r\n                </not>\r\n                <available file=\"${call.script}\"/>\r\n            </and>\r\n        </condition>\r\n    </target>\r\n    <target depends=\"-check-call-dep\" if=\"should.call.dep\" name=\"-maybe-call-dep\">\r\n        <ant antfile=\"${call.script}\" inheritall=\"false\" target=\"${call.target}\">\r\n            <propertyset>\r\n                <propertyref prefix=\"transfer.\"/>\r\n                <mapper from=\"transfer.*\" to=\"*\" type=\"glob\"/>\r\n            </propertyset>\r\n        </ant>\r\n    </target>\r\n</project>"
      }
  , File
      { name = "nbproject/project.properties"
      , content =
          T.pack
            "javadoc.noindex=false\r\njavadoc.nonavbar=false\r\njavadoc.notree=false\r\njavadoc.private=false\r\njavadoc.splitindex=true\r\njavadoc.use=true\r\njavadoc.version=false\r\njavadoc.windowtitle=\r\nmain.class={{name}}.{{class}}\r\nmanifest.file=manifest.mf\r\nmeta.inf.dir=${src.dir}/META-INF\r\nmkdist.disabled=false\r\nplatform.active=default_platform\r\nrun.classpath=\\\r\n    ${javac.classpath}:\\\r\n    ${build.classes.dir}\r\n# Space-separated list of JVM arguments used when running the project.\r\n# You may also define separate properties like run-sys-prop.name=value instead of -Dname=value.\r\n# To set system properties for unit tests define test-sys-prop.name=value:\r\nrun.jvmargs=\r\nrun.test.classpath=\\\r\n    ${javac.test.classpath}:\\\r\n    ${build.test.classes.dir}\r\nsource.encoding=UTF-8\r\nsrc.dir=src\r\ntest.src.dir=test"
      }
  , File
      { name = "nbproject/project.xml"
      , content =
          T.pack
            "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<project xmlns=\"http://www.netbeans.org/ns/project/1\">\r\n    <type>org.netbeans.modules.java.j2seproject</type>\r\n    <configuration>\r\n        <data xmlns=\"http://www.netbeans.org/ns/j2se-project/3\">\r\n            <name>{{name}}</name>\r\n            <source-roots>\r\n                <root id=\"src.dir\"/>\r\n            </source-roots>\r\n            <test-roots>\r\n                <root id=\"test.src.dir\"/>\r\n            </test-roots>\r\n        </data>\r\n    </configuration>\r\n</project>"
      }
  , File
      { name = "build.xml"
      , content =
          T.pack
            "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- You may freely edit this file. See commented blocks below for -->\r\n<!-- some examples of how to customize the build. -->\r\n<!-- (If you delete it and reopen the project it will be recreated.) -->\r\n<!-- By default, only the Clean and Build commands use this build script. -->\r\n<!-- Commands such as Run, Debug, and Test only use this build script if -->\r\n<!-- the Compile on Save feature is turned off for the project. -->\r\n<!-- You can turn off the Compile on Save (or Deploy on Save) setting -->\r\n<!-- in the project's Project Properties dialog box.-->\r\n<project name=\"{{name}}\" default=\"default\" basedir=\".\">\r\n    <description>Builds, tests, and runs the project {{name}}.</description>\r\n    <import file=\"nbproject/build-impl.xml\"/>\r\n    <property name=\"dist.dir\" value=\"dist\"/>\r\n    <property name=\"build.dir\" value=\"build\"/>\r\n    <property name=\"build.classes.dir\" value=\"build/classes\"/>\r\n    <property name=\"dist.javadoc.dir\" value=\"build/javadoc\"/>\r\n    <property name=\"build.test.classes.dir\" value=\"build/test/classes\"/>\r\n    <property name=\"build.test.results.dir\" value=\"build/test/results\"/>\r\n    <property name=\"build.classes.excludes\" value=\"build/classes/excludes\"/>\r\n    <property name=\"dist.jar\" value=\"dist\"/>\r\n    <property name=\"javac.target\" value=\"build/javac\"/>\r\n    <manifest file=\"MANIFEST.MF\">\r\n        <attribute name=\"Bundle-Name\" value=\"${project.name}\" />\r\n        <attribute name=\"Bundle-Version\" value=\"${version.num}\" />\r\n        <attribute name=\"Bundle-Date\" value=\"${NOW}\" />\r\n        <!--<attribute name=\"Bundle-Revision\" value=\"${svna.version}\" />-->\r\n        <attribute name=\"Implementation-Title\" value=\"${project.name}\" />\r\n        <attribute name=\"Implementation-Version\" value=\"${version.num}\" />\r\n        <attribute name=\"Implementation-URL\" value=\"http://www.exampl